import React, { Component } from 'react';
import background from '../images/tree.jpg';

class RegisterDwelling extends Component {

    state = {
        credentials: {
            username: '',
            Password: '',
            password2: '',
            email: '',
            firstname: '',
            lastname: '',
            tel: '',
            address: '',
            homeUsername: '',
            ownerUsername: '',
            collapseID: ''
        }
    }


    render() {
        return (

            <React.Fragment>

                <div class="grid">
                    <header>
                        <Header></Header>
                    </header>

                    <aside class="sidebar-left">
                        <Sidebar></Sidebar>
                    </aside>

                    <article>
                        <AdminPriv></AdminPriv>

                    </article>



                    <aside>
                        <RightSidebar></RightSidebar>
                    </aside>

                    <footer>
                        <Footer></Footer>
                    </footer>

                </div>




            </React.Fragment>

        );
    }

}
function GuidGenerator() {
    var S4 = function () {
        return (((1 + Math.random()) * 0x10000) | 0).toString(16).substring(1);
    };
    var S2 = S4() + "-" + S4();
    console.log(S2);
    return (S2);
}

export default RegisterDwelling;
